import { USER_LOGIN_MODAL_FALSE, USER_LOGIN_MODAL_TRUE } from "../constants/loginConstant";

export const LoginModal = (state={},action)=>{
    switch(action.type){
        case USER_LOGIN_MODAL_TRUE : 
            return {modal:true}
        case USER_LOGIN_MODAL_FALSE :
            return {modal:false}
        default:
            return state
    }
}
